[library]library_name =  "BESMod"[whitelist_library]wh_library_name = "None"[dymola_version]dymola_version = "2023"[python_version]python_version= "py38"[Package]	package_list = [	"Examples",	"Systems",	"Tutorial",	"Utilities",	][stages]	stage_list = [	"check_setting",	"build_templates",	"Ref_Check",	"create_html_whitelist",	"create_model_whitelist",	"create_example_whitelist",	"HTML_Check",	"Style_check",	"model_check",	"simulate",	"RegressionTest",	"plot_ref",	"prepare",	"open_PR",	"build_ci_structure",	"deploy",	"build_ci_whitelist",	]	[git_url]git_url = "None"	[wh_library_path]wh_path = "None"[Merge_Branch]merge_branch = "None_Merge"[image_name]image = "registry.git.rwth-aachen.de/ebc/ebc_intern/dymola-docker:Dymola_2023-miniconda"[variable_list]	variablelist = [	"Github_Repository: RWTH-EBC/BESMod",	"GITLAB_Page: https://ebc.pages.rwth-aachen.de/EBC_all/github_ci/BESMod",	][ci_commit_commands]	commitlist = [	"ci_show_ref",	"ci_create_model_wh",	"ci_create_html_wh",	"ci_create_example_wh",	"ci_simulate",	"ci_check",	"ci_regression_test",	"ci_html",	"ci_setting",	"ci_style_check",	"ci_trigger_ibpsa",	"ci_merge_except",	"ci_correct_html",	"ci_build_structure",	"ci_build_whitelist",	]	[File_list]	filelist = [	"dymola-ci-tests/ci_templates/cleanupscript/ci_build_whitelist.yml",	"dymola-ci-tests/ci_templates/cleanupscript/ci_setting.gitlab-ci.yml",	"dymola-ci-tests/ci_templates/deploy/create_CI_path.yml",	"dymola-ci-tests/ci_templates/deploy/gitlab_pages.yml",	"dymola-ci-tests/ci_templates/syntaxtest/html_check.yml",	"dymola-ci-tests/ci_templates/syntaxtest/style_check.yml",	"dymola-ci-tests/ci_templates/UnitTests/check_model.yml",	"dymola-ci-tests/ci_templates/UnitTests/regression_test.yml",	"dymola-ci-tests/ci_templates/UnitTests/simulate_model.yml",	]	[config_list]	configlist = [	"html",	"style",	"check",	"simulate",	"regression",	][github_repo]github_repo = "RWTH-EBC/BESMod"[gitlab_page]gitlab_page = "https://ebc.pages.rwth-aachen.de/EBC_all/github_ci/BESMod"